import React from 'react';

const TaskContainer = (props) => {
    return(
        <div class="tasks">
            <h5>Tasks</h5>
            <div>
                {props.tasks.map(task => {
                   return ( <div className="task">
                        <div class="label">{task.category}</div>
                    </div>
                    )}
                )}
            </div>
        </div>
    )
}

export default TaskContainer;
